import React from "react";

function Footer() {
  return (
    <>
      <div>
        <button href="https://www.linkedin.com/in/mason-weiner-64ab0220a/">
          LinkedIn
        </button>
        <button href="https://github.com/masonweiner">GitHub</button>
        <button href="https://www.instagram.com/mason_weiner/">
          Instagram
        </button>
      </div>
    </>
  );
}

export default Footer;
